import React, { useState, useEffect } from 'react';
import { BarChart, XAxis, YAxis, CartesianGrid, Bar, ResponsiveContainer, PieChart, Pie, Cell, Sector, Tooltip, Legend } from 'recharts';
import styled from 'styled-components';
import axios from 'axios';



const StyledChart1 = styled.div`
  height: 40%;
  width: 40%; 
  text-align: center; /* Aligns <a> inside of NavIcon div */
  background-color: #F5F5F5;
  margin: 10px 10px;
  padding: 12px 6px;
  border-radius: 5px;

`;
const Wrapper = styled.div`
  margin-top: 5em;
  margin-left: 7em;
  margin-right: 20em;
  margin-bottom: 5em;
`;
const Dashboard = () => {

  const [data, setData] = useState([]);
  useEffect(() => {
    Promise.all([
      axios.get('/dashboard'),
    ]).then((all) => {
      setData(all[0].data);   

    });
  }, []);


const test = data[0]
console.log(test[command]);

// console.log(alldata.rows[0].count);
// const data1 = alldata[0].rows[0].count;
// const data2 = alldata[1].rows[0].count;
// const data5 = alldata[2].rows[0].count;
// const data6 = alldata[3].rows[0].count;
// const data7 = alldata[4].rows[0].count;
//  let data8 = alldata[0];
//  console.log(data8);
// const data9 = alldata[6].rows[0].sum;
// console.log("data1", data1);
// console.log("data2", data2);
// console.log("data3", data3);
// console.log("data4", data4);
// console.log("data5", data5);
// console.log("data6", data6);
// console.log("data7", data7);

//  const data = [
//     { name: 'Quality reviews in progress', value: 152 }, { name: 'Quality review completed', value: 300 },
//   ];

const COLORS = ['#FFC107', '#4CAF50', '#FFBB28', '#FF8042'];
const RADIAN = Math.PI / 180;
const renderCustomizedLabel = ({
  cx, cy, midAngle, innerRadius, outerRadius, percent, index,
}) => {
  const radius = innerRadius + (outerRadius - innerRadius) * 0.5;
  const x = cx + radius * Math.cos(-midAngle * RADIAN);
  const y = cy + radius * Math.sin(-midAngle * RADIAN);

  return (
    <text x={x} y={y} fill="white" textAnchor={x > cx ? 'start' : 'end'} dominantBaseline="central">
      {`${(percent * 100).toFixed(0)}%`}
    </text>
  );
};

const data3 = [
  {
    name: 'Current', current: 10,
  },
  {
    name: 'Completed', completed: 15,
  },
  {
    name: 'Upcoming', upcoming: 5,
  },

];

const data4 = [
  { name: 'Group A', value: 400 },
  { name: 'Group B', value: 300 },
];

return (

  <Wrapper>
  <div className ='App'>   
  {/* <h2>Dashboard</h2> */}
  <StyledChart1>
  <h5> Quality reviews </h5>
  <PieChart width={400} height={400}>
          <Pie
          data={data}
          cx={200}
          cy={200}
          //labelLine={true}
          //label
          labelLine={false}
          label={renderCustomizedLabel}
          outerRadius={100}
          fill="#8884d8"
          dataKey="value"
          Legend
        >
          {
            data.map((entry, index) => <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />)
          }
        </Pie>
        <Tooltip/>
        <Legend/>
  </PieChart>
  </StyledChart1>
  {/* <StyledChart1> */}
  <h5> Projects </h5>
  <BarChart
        width={500}
        height={300}
        data={data3}
        margin={{
          top: 5, right: 30, left: 20, bottom: 5,
        }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
        <Bar dataKey="current" fill="#8884d8" />
        <Bar dataKey="completed" fill="#82ca9d" />
        <Bar dataKey="upcoming" fill="#4CAF50" />
  </BarChart>
  {/* </StyledChart1> */}

{/* <StyledChart1> */}

<PieChart width={800} height={400} >
        <Pie
          data={data4}
          cx={120}
          cy={200}
          innerRadius={60}
          outerRadius={80}
          fill="#8884d8"
          paddingAngle={5}
          dataKey="value"
        >
          {
            data.map((entry, index) => <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />)
          }
        </Pie>
        <Tooltip />
        <Legend />
        </PieChart>
{/* </StyledChart1> */}





</div>
</Wrapper>
)

};

export default Dashboard;
